INSERT INTO `subir_recetasadministracion` VALUES (6,'Crema Pastelera con Café','Parva','niños','imagenes/cremapasteleracafe.jpg','1.	En la licuadora añadir la leche condensada, la leche, la esencia de vainilla, el baileys, las 2 cucharadas de café soluble, la maizena…\r\n2.	Así, procesar a alta velocidad hasta disolver bien la maizena... \r\n3.	En una olla e teflón llevar al fuego y comenzar a mezclar a medida que comienza a hervir para que no se formen grumos… \r\n4.	Y va tomando consistencia cremosa, rectificar punto de dulce, bajar del fuego y dejar se refresque un poco sin dejar de mezclar...\r\n5.	Añadir la crema de leche y mezclar vigorosamente hasta integrar bien la crema de leche.\r\n6.	tapar con papel film para que no haga costra, hasta el momento de usar. Espero la disfruten, de Tunevera con gusto.','aproximadamente una hora','25 minutos',NULL,NULL,NULL,25,1,'2018-06-14 06:41:19'),(8,'Sudado de Pollo','Arroces','almuerzo','imagenes/sudado.jpg','1.En una olla grande, caliente el aceite vegetal a fuego medio.\r\n2.Añadir la cebolla y el pimiento rojo y saltee hasta que las cebollas estén transparentes, unos 3 minutos. A continuación, añadir los tomates, el ajo, la sal y la pimienta molida y sofría por 5 minutos más.\r\n3.Agregue el pollo, el caldo de pollo, la sazón y comino en polvo.\r\n4.Tapar y cocinar durante 25 minutos, revolviendo ocasionalmente.\r\n5.Añadir las papas y el cilantro y cocine por 30 minutos más o hasta que las papas estén tiernas. Sirva sobre arroz blanco.','La cocción es de mínimo 30 minutos.','Tarda aproximadamente 25 minutos.','125kcl','100pt','25x',25,1,'2018-06-14 17:00:00'),(9,'Arroz con Coco','Arroces','almuerzo','imagenes/arrozconcoco.jpg','1.	Instrucciones\r\n2.	Para comenzar es recomendable que laves bien el arroz. Una vez tu arroz esté libre de almidón , corta la pulpa de los cocos en trozos pequeños. Luego mételos en la licuadora, agrega el agua de los cocos y 2 tazas de agua tibia. Una vez el coco esté licuado, pasa esta leche por un colador y reserva el bagazo.\r\n3.	Coloca la leche de coco exprimida en una olla y agrega las 3 cucharadas de azúcar. Deja que la leche hierva a fuego medio hasta que el agua se evapore y solamente quede el aceite de coco y unos granitos negros, esto se conoce como titote.\r\n4.	El titote lo venden en los supermercados de la costa atlántica colombiana pero es muy escaso en las tiendas especializadas de los Estados Unidos, así que por esto es mejor prepararlo todo en casa .\r\n5.	Toma el bagazo del coco que habías reservado, agrega otras cinco tazas de agua y vuelve a licuar. Una vez tengas lista esta nueva mezcla, sírvela en la misma olla en la que tienes el titote cocinándose a fuego medio. Agrega la sal y el arroz lavado y revuelve constantemente para que no se pegue.\r\n6.	Una vez el arroz comience a secar, agrega las uvas pasas y reduce el fuego a bajo. Tapa la olla y deja que tu arroz se termine de cocer durante aproximadamente unos 15 minutos.\r\n7.	Este arroz se come tradicionalmente con pescado frito, tostones y ensalada; un clásico almuerzo costeño. Claro está que este arroz también va muy bien con pollo o carne asada y queda muy bien con vegetales al horno y salsa bechamel.\r\n8.	Sea como sea, el arroz con coco va bien solo o acompañado así que ya sabes la receta para deleitar tu paladar.','Aproximademente 60 minutos.','Apróximademente 45  minutos.','80klc','500p','133x',25,1,'2018-04-11 19:42:14'),(11,'Trucha al Horno','Mariscos','almuerzo','imagenes/truchaalhorno.jpg','1.	En una olla con abundante agua realizar una pre-cocción de las patatas sin pelar, cortadas en cuartos durante 15 minutos.\r\n2.	Cuando las patatas estén listas, córtalas en rodajas gruesas, espolvorea un poco de paprika, sal y pimienta, reserva.\r\n3.	Retirar la cabeza y las espinas de la trucha, disponer los filetes sobre las patatas, aderezar con ajo macerado, una gotas de limón, sal, pimienta, una pizca de finas hierbas y un poco de aceite. Llevar al horno a 200ºC durante 10 minutos.\r\n4.	Cuando esté lista la trucha con patatas al horno, servir y disfrutar. Esta receta es perfecta para la hora del almuerzo o para una cena ligera, si lo deseas, puedes acompañar con una rodaja de limón y una ensalada fresca. Si te ha gustado esta receta, tienes algún comentario o inquietud, danos tu opinión.','Tiempo de cocción aproximademente 25min','Tiempo de preparación aproximademente 15min','150klc','250p','25x',25,1,'2018-02-08 20:16:21'),(12,'Ajiaco Colombiano','Mariscos','almuerzo','imagenes/ajicoxxx.jpg','1.	En una olla grande ponemos a hervir agua y añadimos la pechuga entera a cocinar con pizca de sal. Cuando esté a medio cocer, reemplazamos el agua que se ha consumido por 4 tazas de leche, hirviendo esta mezcla añadimos la papa criolla cortada a la mitad con piel, la papa sabanera pelada y cortada en cuartos, la guasca, la cebolla larga cortada en aros pequeños y la sal, agregamos el maíz y seguimos cocción.\r\n\r\n2.	Cuando la pechuga esté blanda, la retiramos de la olla y en una fuente la desmechamos grueso. Tenemos el aguacate listo, las alcaparras y la crema de leche para servir.\r\n\r\n3.	Devolvemos la pechuga desmechada a la olla, damos unos minutos de hervor y apagamos fuego, dejamos olla tapada hasta el momento de servir. \r\n\r\n4.	Servimos nuestro ajiaco con aguacate, crema de leche y alcaparras como aprecian en la fotografía.\r\n\r\n5.	Para acompañar: Aguacate, Crema de leche, Alcaparras, Arroz blanco y Gotas tabasco al gusto','75 minutos','1 hora',NULL,NULL,NULL,2,1,'2018-06-14 20:19:53'),(13,'Buñuelos Colombianos','Parva','desayuno','imagenes/bueñuelitos.jpg','1.	Rallar el queso. Mezclar todos los ingredientes menos el polvo de hornear, hasta obtener una masa uniforme, si está muy seca agregar un poco de agua tibia. \r\n\r\n2.	Agregar el polvo de hornear e incorporar bien. Armar los buñuelos en bolas pequeñas y uniformes.\r\n\r\n3.	Calentar el aceite preferiblemente en una olla grande y honda para que puedan flotar, no calentar a fuego muy alto porque se pueden freír afuera, pero por dentro quedan crudos, solo fuego medio y constante. Dejarlos hasta dorar por unos 20 o 25 min.\r\n\r\n4.	Ponerlos en papel absorbente y servirlos calientes..','20 a 25 minutos','1 hora',NULL,NULL,NULL,2,1,'2018-06-14 20:23:40'),(14,'Bandeja paisa','Arroces','almuerzo','imagenes/bandejapaisa.jpg','1.	Lo primero es dejar los frijoles en remojo durante toda noche antes de cocinarlos, luego en una olla los cueces hasta que estén blandos. Mientras puedes ir haciendo el arroz en un sofrito de aceite, sal y cebolla larga. En casi toda Latinoamérica tienen la costumbre de lavar el arroz dos o tres veces antes de ponerlo a hervir, para que suelte el almidón, pero ahí el gusto de cada uno o cada una.\r\n\r\n2.	En otra sartén sofreír la carne picada y añadir la mitad del hogao, como te explicaba el hogao es una especie de sofrito de tomate y cebolla, y remover con una cuchara. Los chicharrones los haces tú mismo o misma friendo la carne de cerdo con la piel.\r\n\r\n3.	Cuando ya está todo vas sirviendo en una bandeja, los chicharrones aparte, el arroz, mezcla los frijoles con la carne y también lo pones, a esto le añades el patacón (en el próximo párrafo te explico como se hacen) un par de huevos fritos, y un aguacate partido en cuatro. A todo buen colombiano le gusta el ají pique, así que si le añades un poco te lo agradecerá.\r\n\r\n4.	Te cuento lo del patacón. Básicamente son trozos aplanados fritos de plátano verde. Se pueden comer solos o poniéndoles encima cualquier cosa que se te ocurra, aunque lo más usual son los huevos revueltos, queso costeño, como ves en la foto, carne, pescado frito.','1 hora y 15 minutos','aproximadamente dos horas',NULL,NULL,NULL,2,1,'2018-06-14 20:29:07'),(15,'Arepa de chócolo','Parva','desayuno','imagenes/arepadechocoloco.jpg','1.Coloque todos los ingredientes en la licuadora y mezcle hasta obtener una masa espesa.\r\n2.Derretir la mantequilla en una sartén grande o una plancha para asar, a fuego medio.\r\n3.Mantener la sartén a fuego medio, añadir aproximadamente 1/4 de taza de la masa en la sartén.\r\n4.Cocine hasta que los lados estén dorados, unos 2 minutos. Voltear con una espátula y cocine por 2 minutos más en el otro lado.\r\n5.Si quieres terminar en el horno: Coloque la cacerola en el horno y cocinar 3 a 4 minutos, hasta que se dore.\r\n6.Sirva inmediatamente o transferir a un plato y cubrir con papel de aluminio para mantenerlas calientes. Repita con el resto de la masa, agregar más mantequilla a la sartén si es necesario. Servir con mantequilla y queso blanco por encima.','Aproxidamente 10 minutos.','Apróxidamente 20 minutos.','80klc','150p','100x',25,1,'2018-04-13 05:00:00'),(16,'Torta de Lenteja','Arroces','almuerzo','imagenes/tortadelenteja.jpg','Esta receta es con el fin de utilizar las lentejas que nos quedan después de una buena sopa... Las lentejas se cuelan para que queden totalmente secas.\r\n\r\nEn un recipiente plástico las adicionamos y le agregamos: la cebolla, el huevo, la harina, la avena y sal opcional\r\n\r\nSe revuelve hasta que la mezcla quede cremosa.\r\n\r\nPor último, con una cuchara se saca la porción que se desee para armar la tortica y echarla al fogón con aceite bien caliente, se dejan dorar al gusto.','5 minutos','10 minutos',NULL,NULL,NULL,38,1,'2018-06-16 00:54:03'),(17,'Pizza','Parva','comidas rapidas','imagenes/pizzacorrecta.jpg','1. En un bol ponemos todos los ingredientes de la masa: harina, agua, levadura, aceite y sal y mezclamos bien con una cuchara. Una masa de pizza es como un pan sencillo. Se puede hacer con cualquier tipo de harina y la cantidad de agua será aproximadamente de la mitad de la de harina. Si usamos una harina con más cantidad de gluten (harina de fuerza) entonces necesitaremos algo más de agua y si utilizamos una harina normal (como la de hoy) con la mitad de agua (por harina) y un poco más será suficiente.\r\n\r\n2. Acto seguido pasaremos a amasar. Si tenemos una amasadora estupenda, no tendremos que hacer gran cosa. Si no tenemos, lo único que haremos será estirar la masa y recoger con la palma de la mano hasta conseguir una masa que no se pega a las manos ni a la mesa, es una masa fina y elástica. Entre 5 y 10 minutos serán más que suficientes. No hará falta enharinar la mesa.\r\n\r\n3. A continuación dejaremos fermentar la masa tapada. El objetivo es que quede el doble de volumen. ¿Y eso cuando lo hace? La respuesta es sencilla, si hace frio tardará más que si hace calor. O al contrario, si hace calor tardará menos. Las mejores masas cuanto más tarden mejor porque la masa se desarrolla de otra forma, pero con nuestra pizza sin complicaciones nos dará igual. Nosotros la dejamos y cuando suba al doble seguiremos por el siguiente paso.\r\n\r\n4. Ahora que nuestra masa ha crecido lo suficiente podemos continuar. Cogemos la masa y la desgasificamos, es decir la amasamos ligeramente para que vuelva a su volumen inicial. Podemos pasar a dividirla para hacer pizzas pequeñas o hacer una grande. Para estirarla sin complicaciones la estiramos con las manos como podamos o bien con un rodillo, la forma es lo de menos, si sale cuadrada adelante si conseguís una masa redonda genial. Le pondremos los ingredientes, primero el tomate, después el queso y el resto de cosas que queramos añadir.\r\n\r\n5. El último paso es el del horno, y no es el menos importante. Con el horno precalentado a un mínimo de 230 ºC metemos la pizza. Podemos usar una piedra para el horno o una bandeja. Si tenemos piedra la base de la pizza quedará más crujiente pero no nos tenemos que complicar la vida, quedan muy ricas en cualquier bandeja que tengáis.\r\n\r\n6. Hornearemos durante unos 8-10 minutos, hasta que se dore ligeramente.','15 minutos','20 minutos',NULL,NULL,NULL,2,1,'2018-06-16 01:04:51'),(18,'Ponche Colombiano','Bebidas','cena','imagenes/ponchecolombiano.jpg','Se pone a hervir esta mezcla u con ayuda de un molinillo se bate rápidamente hasta que suba.\r\n\r\nSe sirve caliente y se rocía canela en polvo.','15 Minutos','5 minutos',NULL,NULL,NULL,38,1,'2018-06-16 01:11:47'),(19,'Sopa de Mondongo','vegetales','almuerzo','imagenes/sopamondongo.jpg','Se corta la pata y el callo en cuadritos.\r\n\r\nSe pone a pitar con un gajo de cebolla larga y sal durante una hora aproximadamente.\r\n\r\nCuando ya esté blando se le retira esa agua con la que se cocinó y se agrega las papas, arveja (chicharos), las zanahorias rayadas y el segundo gajo de cebolla finamente picado. Se rectifica de sal y se le agrega agua hasta que cubra todo.\r\n\r\nSe deja cocinar aproximadamente durante 30 minutos hasta que todo esté blando.\r\n\r\nPor último se sirve poniéndole cebolla finamente picada y cilantro finamente picado, se puede acompañar con aguacate o banana.','30 minutos','45 Minutos',NULL,NULL,NULL,38,1,'2018-06-16 01:24:42'),(20,'Croquetas de Papa, atún y maíz','Arroces','almuerzo','imagenes/croquetasxd.jpg','Preparar el puré con la mitad de lo que indica el envase. Dejar enfriar.\r\n\r\nColocar en un bowl el puré frío, la lata de atún, la lata de choclo, y condimentar a gusto con sal (optativo algún condimento o ají molido, como puse en mi caso).\r\n\r\nAgregar un huevo y el pan rallado.\r\n\r\nArmar bolitas, y pasarlas por harina.\r\n\r\nCocinarlas 30 minutos en freidora de aire con apenas rocío vegetal, o bien 5 minutos de cada lado en sartén con aceite convencional.\r\n\r\nDisfrutarlas con ensalada o la guarnición que les guste, o bien, con carnes, y que sirva de acompañamiento.','15 Minutos','30 minutos','200klc','100p','100x',38,1,'2018-06-16 01:38:41'),(21,'Arroz Con Leche','Arroces','niños','imagenes/arrozconleche.jpg','Poner a cocinar el arroz con el agua y azúcar\r\n\r\nCuando el arroz esté blando agregar la leche y dejar reducir un rato\r\n\r\nAdicionar la leche condensada y las uvas pasas y la ralladura de limón y la pizca de sal, mezclar bien\r\n\r\nPoner en moldes individuales, decorar con una uva pasa, tapar y refrigerar. Servir bien frío.','15 Minutos','10 minutos','100kcl','150p','3222x',40,1,'2018-06-16 01:53:00'),(22,'Crema de Brocoli','vegetales','niños','imagenes/cremadebrocoli.jpg','Lavar bien las verduras, cortar el brócoli en trozos más pequeños incluyendo los tallos. Si los tallos traen ramitas, removerlas.\r\n\r\nCortar la cebolla y la papa en trozos más pequeños\r\n\r\nAgregar brócoli, papa, cebolla picada y la Porción de pollo en una olla\r\n\r\nAgregar agua hasta que cubra 1 dedo por encima de los vegetales\r\n\r\nAgregar 1 pizca de sal y 1 pizca de ajo en polvo (o se puede agregar 1 diente de ajo triturado)\r\n\r\nCocinar a fuego alto con la olla tapada hasta que hierva el agua. Probar que todo esta cocido (con un tenedor puyar el brócoli y la papa, si entra suave ya esta cocido, si entra con dificultad dejar hirviendo hasta que ablande y el tenedor entre fácil)\r\n\r\nCuando estén cocidos los vegetales, tomar cuchara sopera y agregar el contenido de la olla en la licuadora. Licuar hasta que la consistencia se observe espesa\r\n\r\nVerter el contenido de la licuadora nuevamente en la olla y cocinar a fuego lento. Este es el momento para corregir sal y espesor. Si esta simple agregar sal al gusto, si esta muy espesa agregar agua hasta obtener la consistencia deseada. Cuando se corrijan los defectos apagar y servir.','15 Minutos','20 Minutos','160kcl','150p','100x',38,1,'2018-06-16 02:13:07'),(23,'Torta Casera','Parva','niños','imagenes/tortacasera.jpg','En un bowl batir manteca junto con azúcar y huevos, hasta lograr que quede una preparación cremosa, agregar la esencia de vainilla\r\n\r\nTamizar la harina e ir incorporándo al batido, intercalando con la leche.\r\n\r\nSeparar la masa en dos bols, a una de ellas agregárle el chocolate derretido a baño María y unificar.\r\n\r\nEn un molde enmantecado y enharinado ir alternando por cucharadas los dos gustos, y por último con un cuchillo hacer algunas ondas.\r\n\r\nCocinar en horno mderado(180º), hasta que al introducir un cuchillo salga seco.\r\n\r\nCortar, servir y disfrutar con unos ricos mates.\r\n\r\nO para el café.','45 minutos','10 minutos','125kcl','100p','15x',72,1,'2018-06-16 02:19:00');
